import { loremIpsum } from 'lorem-ipsum';
import ilusha from './ilusha.jpg';

const BuildPage = (index) => (
  <div>
    <h3>Page {index}</h3>
    <div>
      Page {index} content: { loremIpsum({ count: 50 })}
    </div>
  </div>
);

const Pasko = (message) => {
    message = 'Плохо'
    return (
    <div>
        <h1>{message} </h1>
        <div>
        <img src= {ilusha}/>
        </div>
    </div>
    )
}

function ClickButton(props) {

  function press(){
      alert("Hello React!")
  }
  return <button onClick={press}>Click</button>;
}



export const PageOne = () => BuildPage(1);
export const PageTwo = () => BuildPage(2);
export const PageThree = () => Pasko('message');
